   t1."index" AS "index",
   t1.node_id AS node_id,
   t2.nid AS nid,
   t2."P_0" AS "P_0", t2."P_1" AS "P_1", t2."P_2" AS "P_2", t2."P_3" AS "P_3", t2."P_4" AS "P_4", t2."P_5" AS "P_5", t2."P_6" AS "P_6", t2."P_7" AS "P_7", t2."P_8" AS "P_8", t2."P_9" AS "P_9", 
   t2."D" AS "D", 
   t2."DP" AS "DP"
  FROM
   "DT_node_lookup_1" AS t1
   LEFT OUTER JOIN
   "DT_node_data_1" AS t2
   ON t1.node_id = t2.nid
 ),
"DT_node_lookup_2" AS 
 (SELECT
    t."index" AS "index",
    COALESCE( t1."Leaf_13", t1."Leaf_14", t1."Leaf_15", t1."Leaf_17", t1."Leaf_18", t1."Leaf_19", t1."Leaf_27", t1."Leaf_28", t1."Leaf_32", t1."Leaf_35", t1."Leaf_36", t1."Leaf_38", t1."Leaf_39", t1."Leaf_40", t1."Leaf_41", t1."Leaf_42", t1."Leaf_43", t1."Leaf_44", t1."Leaf_45", t1."Leaf_46", t1."Leaf_49", t1."Leaf_51", t1."Leaf_52", t1."Leaf_53", t1."Leaf_54", t1."Leaf_55", t1."Leaf_56", t1."Leaf_57", t1."Leaf_58", t1."Leaf_59", t1."Leaf_60" ) AS node_id
  FROM
    "model_input" AS t
    LEFT OUTER JOIN
   (SELECT
      t."index" AS "index",
      CASE WHEN((t."X_42" > 5.500000) AND (t."X_34" > 13.500000) AND (t."X_46" <= 3.500000) AND (t."X_45" <= 8.000000) AND (t."X_51" <= 15.500000)) THEN 13 ELSE NULL END AS "Leaf_13",
      CASE WHEN((t."X_42" > 5.500000) AND (t."X_34" > 13.500000) AND (t."X_46" <= 3.500000) AND (t."X_45" <= 8.000000) AND (t."X_51" > 15.500000)) THEN 14 ELSE NULL END AS "Leaf_14",
      CASE WHEN((t."X_42" > 5.500000) AND (t."X_34" <= 13.500000) AND (t."X_25" <= 2.500000) AND (t."X_13" > 4.500000) AND (t."X_12" <= 9.500000)) THEN 15 ELSE NULL END AS "Leaf_15",
      CASE WHEN((t."X_42" > 5.500000) AND (t."X_34" <= 13.500000) AND (t."X_25" <= 2.500000) AND (t."X_13" > 4.500000) AND (t."X_12" > 9.500000) AND (t."X_49" <= 3.500000)) THEN 17 ELSE NULL END AS "Leaf_17",
      CASE WHEN((t."X_42" > 5.500000) AND (t."X_34" <= 13.500000) AND (t."X_25" <= 2.500000) AND (t."X_13" > 4.500000) AND (t."X_12" > 9.500000) AND (t."X_49" > 3.500000)) THEN 18 ELSE NULL END AS "Leaf_18",
